void TBody::CalcuSfAccR(int k_12,int ord,int k_ord,TVector X)
{ double sum;
  int si,ei,d;
  d=ord/2-1;

  if(k_12>7||k_12<-7||k_ord>d+2||k_ord<-d-2) return;

  si=(k_12-k_ord)-d-1;  ei=(k_12-k_ord)+d+1;

  if(k_ord>=0)
    for(int m=0;m<3;m++)
        { sum=0.0000000000000000000000000;
          for(int i=si;i<ei;i++) sum+=_UP[d][_Un[d][1]*k_ord+(i-si)]*f[m][i+7];
          sf[m][k_12+7]=X[m]-sum/_CP[d][0];
        }
  else
    for(int m=0;m<3;m++)
        { sum=0.0000000000000000000000000;
          for(int i=si;i<ei;i++) sum+=_UP[d][_Un[d][1]*k_ord+(ei-i)]*f[m][i+7];
          sf[m][k_12+7]=X[m]-sum/_CP[d][0];
        }
}

void TBody::CalcuIntXv(int k,TVector& X,TVector& V)
{ double sum,fp;

  if(k>=0)
    { for(int m=0;m<3;m++)
        { sum=0.0000000000000000000000000;
          for(int i=0;i<13;i++) sum+=_U12ord[0][k][i]*f[m][i+1];
          X[m]=sf[m][k+7]+sum/_Com12ord[0];

          sum=0.0000000000000000000000000;
          for(int i=0;i<13;i++) sum+=_U12ord[1][k][i]*f[m][i+1];
          fp=sf[m][k+7]-sf[m][k+6]+f[m][k+7]/2;
          V[m]=(fp+sum/_Com12ord[1])/h;
        }
    }
  else
    { for(int m=0;m<3;m++)
        { sum=0.0000000000000000000000000;
          for(int i=0;i<13;i++) sum+=_U12ord[0][-k][12-i]*f[m][i+1];
          X[m]=sf[m][k+7]+sum/_Com12ord[0];

          sum=0.0000000000000000000000000;
          for(int i=0;i<13;i++) sum+=_U12ord[1][-k][12-i]*f[m][i+1];
          fp=sf[m][k+8]-sf[m][k+7]-f[m][k+7]/2;
          V[m]=(fp-sum/_Com12ord[1])/h;
        }
    }
}

void TBody::CalcuFloatXv(double dtVh,TVector& X,TVector& V)
{ int k;
  double n,sumi,sumj,sumjv,fp;

  k=int(dtVh>=0?dtVh+0.500000000000000000000:dtVh-0.500000000000000000000);

  if(k>6)  k=6;
  if(k<-6) k=-6;

  n=dtVh-k;

  if(k>=0)
    { for(int m=0;m<3;m++)
        { fp=sf[m][k+7]-sf[m][k+6]+f[m][k+7]/2;
          sumj=0.00000000000000000000;
          sumjv=0.00000000000000000000;

          for(int j=14;j>=2;j--)
            { sumi=0.00000000000000000000;
              for(int i=0;i<13;i++) sumi+=_U12ord[j][k][i]*f[m][i+1];
              sumj+=pow(n,j)*sumi/(_Factorial[j]*_Com12ord[j]);
              sumjv+=pow(n,j-1)*sumi/(_Factorial[j-1]*_Com12ord[j]);
            }
          sumi=0.00000000000000000000;
          for(int i=0;i<13;i++) sumi+=_U12ord[1][k][i]*f[m][i+1];
          sumj+=n*sumi/(_Factorial[1]*_Com12ord[1]);
          sumjv+=sumi/(_Factorial[0]*_Com12ord[1]);
          sumi=0.00000000000000000000;
          for(int i=0;i<13;i++) sumi+=_U12ord[0][k][i]*f[m][i+1];
          sumj+=sumi/(_Factorial[0]*_Com12ord[0]);

          X[m]=sf[m][k+7]+n*fp+sumj;
          V[m]=(fp+sumjv)/h;
        }
    }
  else
    { for(int m=0;m<3;m++)
        { fp=sf[m][k+8]-sf[m][k+7]-f[m][k+7]/2;
          sumj=0.00000000000000000000;
          sumjv=0.00000000000000000000;
          for(int j=14;j>=2;j--)
            { sumi=0.00000000000000000000;
              for(int i=0;i<13;i++) sumi+=_U12ord[j][-k][12-i]*f[m][i+1];
              sumj+=(j%2==0?1:-1)*pow(n,j)*sumi/(_Factorial[j]*_Com12ord[j]);
              sumjv+=(j%2==0?1:-1)*pow(n,j-1)*sumi/(_Factorial[j-1]*_Com12ord[j]);
            }
          sumi=0.00000000000000000000;
          for(int i=0;i<13;i++) sumi+=_U12ord[1][-k][12-i]*f[m][i+1];
          sumj+=-n*sumi/(_Factorial[1]*_Com12ord[1]);
          sumjv+=-sumi/(_Factorial[0]*_Com12ord[1]);
          sumi=0.00000000000000000000;
          for(int i=0;i<13;i++) sumi+=_U12ord[0][-k][12-i]*f[m][i+1];
          sumj+=sumi/(_Factorial[0]*_Com12ord[0]);

          X[m]=sf[m][k+7]+n*fp+sumj;
          V[m]=(fp+sumjv)/h;
        }
    }
}

void TBody::CalcuSfAccCentral3(int endk)
{ for(int j=0;j<3;j++)
    { for(int k=2;k<=endk;k++) sbs(1,k);
      for(int k=-2;k>=-endk;k--)sbs(-1,k);
    }
}


void TBody::CalcuCentralSf3(int order,TVector X,TVector V)
{ double sum;
  int d=order/2-1;

  for(int m=0;m<3;m++)
    { sum=0.0000000000000000000000000;
      for(int k=-d-1;k<=d+1;k++) sum+=_UP[d][k+d+1]*f[m][k+7];
      sf[m][7]=X[m]-sum/_CP[d][0];

      sum=0.0000000000000000000000000;
      for(int k=-d-1;k<=d+1;k++) sum+=_UP[d][_Un[d][0]+k+d+1]*f[m][k+7];
      sf[m][6]=sf[m][7]-V[m]*h+(sum/_CP[d][1]+f[m][7]/2);

      sbs(1,1);
    }
}



void TBody::CalcuIntXv(int k_12,int order,int k_ord,TVector& X,TVector& V)
{ double sum,fp;
  int si,ei,d;

  d=order/2-1;
  si=(k_12-k_ord)-order/2;
  ei=(k_12-k_ord)+order/2;
  if(ei>7||si<-7) { X.VZero(); V.VZero(); return;}

  if(k_ord>=0)
    { for(int m=0;m<3;m++)
        { sum=0.0000000000000000000000000;
          for(int k=si;k<=ei;k++) sum+=_UP[d][k_ord*_Un[d][1]+k-si]*f[m][k+7];
          X[m]=sf[m][k_12+7]+sum/_CP[d][0];

          sum=0.0000000000000000000000000;
          for(int k=si;k<=ei;k++) sum+=_UP[d][_Un[d][0]+k_ord*_Un[d][1]+k-si]*f[m][k+7];
          fp=sf[m][k_12+7]-sf[m][k_12+6]+f[m][k_12+7]/2;
          V[m]=(fp+sum/_CP[d][1])/h;
        }
    }
  else
    { for(int m=0;m<3;m++)
        { sum=0.0000000000000000000000000;
          for(int k=si;k<=ei;k++)  sum+=_UP[d][-k_ord*_Un[d][1]+ei-k]*f[m][k+7];
          X[m]=sf[m][k_12+7]+sum/_CP[d][0];

          sum=0.0000000000000000000000000;
          for(int k=si;k<=ei;k++)  sum+=_UP[d][_Un[d][0]-k_ord*_Un[d][1]+ei-k]*f[m][k+7];
          fp=sf[m][k_12+8]-sf[m][k_12+7]-f[m][k_12+7]/2;
          V[m]=(fp-sum/_CP[d][1])/h;
        }
    } 
}

void TBody::sbs(int dir,int k_next)
{ if(dir>=0)
    for(int m=0;m<3;m++)
      { sf[m][k_next+7]=sf[m][k_next+6]*2-sf[m][k_next+5]+f[m][k_next+6];
      }
  else
    for(int m=0;m<3;m++)
      { sf[m][k_next+7]=sf[m][k_next+8]*2-sf[m][k_next+9]+f[m][k_next+8];
      }
}

void TBody::WriteF(int k,TVector A)
{ for(int j=0;j<3;j++) f[j][k+7]=A[j]*h*h;
}

void TBody::MoveForwardOnce()
{ for(int m=0;m<3;m++) for(int i=0;i<14;i++)
    { f[m][i]=f[m][i+1];
      sf[m][i]=sf[m][i+1];
    }
}

void TBody::MoveBackOnce()
{ for(int m=0;m<3;m++)  for(int i=14;i>0;i--)
    { sf[m][i]=sf[m][i-1];
      f[m][i]=f[m][i-1];
    }
}
                  
